        "description": "Gabriel Martinelli popped up with the winner 13 minutes from time to beat Aston Villa 2-1 and extend our winning start to the season to five games.\n\nThe Brazilian netted the crucial goal just three minutes after the visitors had pulled level against the run of play through a Douglas Luiz effort direct from corner, which cancelled out Gabriel Jesus‚Äô 30th-minute strike.\n\nHowever Martinelli‚Äôs third goal of the season handed us a deserved victory from a game we dominated throughout, which was the 200th since we moved to Emirates Stadium. \n\nIt took just 10 minutes for Emiliano Martinez to begin seeing his goal peppered with shots from all angles. Firstly, Jesus forced him into a save, and from the resulting corner Gabriel saw an effort deflect narrowly wide, and then the defender shot straight at our former shot-stopper.\n\nJesus would test his fellow South American again before a desperate block by Tyrone Mings prevented Martin Odegaard from netting for the third game in succession, and then with the goal gaping Bukayo Saka managed to screw a dangerous cross wide as a golden chance went begging.\n\nBut finally, on the half-hour mark they made their pressure tell. There wasn‚Äôt much danger when Martinelli found Granit Xhaka on the edge of the boxbut his low cross clipped Ezri Konsa and spun goalwards, forcing Martinez to palm the ball into the path of Jesus who gobbled up the chance to put his side in front.\n\nVilla offered very little in attack in the opening 45 minutes, and were lucky to escape into the interval just one goal behind when a goalmouth scramble following another Jesus saved shot saw the ball hacked off the line, and an amazing full-length save by Martinez denied Martinelli netting an outrageous half-volley which looked destined for the top corner.\n\nFollowing the restart, chances were more of a premium despite us getting into plenty of promising positions. Odegaard again forced Martinez to fling himself through the air